const AboutMe = () => (
  <div className="aboutMe">
    <div className="aboutMe-description">
      <h1>Hi, There..!!</h1>
      <h1>I'm Sai</h1>
      <a href="#contactme">
        <button className="aboutMe-contactButton">Contact Me</button>
      </a>
    </div>
    <img className="aboutMe-image" src="images/happy.png" alt="Funny" />
  </div>
);

export default AboutMe;
